import { DocumentMember } from '../../entities/DocumentMember';
import { Document } from '../../entities/Document';
import { User } from '../../entities/User';
import { TIMESTAMP } from '../../util/timestamps';
import { throwError } from '../../../../../shared/errors';

const addDocumentMember = async (p, args, context) => {
  const { input: newDocumentMember } = args;
  const now = TIMESTAMP;

  const user = await User.buildFromId(newDocumentMember.userId, 'Mutation.addDocumentMember', context);
  const member = await DocumentMember.create(user.id, newDocumentMember.documentId, now, 'Mutation.addDocumentMember', context);
  const newDoc = await Document.buildFromId(newDocumentMember.documentId, newDocumentMember.userId, 'Mutation.addDocumentMember', context);

  const result = await member.resolveAsEntity();
  await newDoc.publishEvent(context.pubsub, 'EDIT');
  return result;
};

const editDocumentMember = async (p, args, context) => {
  const { documentId, userId, input } = args;
  const document = await Document.buildFromId(documentId, userId, 'Mutation.editDocumentMember', context);
  if (!document) {
    throwError('Mutation.editDocumentMember()', '[Document] Entity not found.');
  }
  const member = await DocumentMember.buildFromId(
    { documentId, userId },
    "Mutation.editDocumentMember",
    context
  );
  if (!member) {
    return {
      __typename: 'MemberNotFound',
      message: 'DocumentMember not found'
    };
  }

  await member.setMultiple(input);
  await member.save();
  document.publishEvent(context.pubsub, 'EDIT');
  return member.resolveAsEntity();
};

const deleteDocumentMember = async (p, args, context) => {
  const { memberId } = args.input;
  const member = await DocumentMember.buildFromId({ memberId }, 'Mutation.deleteDocumentMember', context);
  const deleteResult = await member.delete();
  const doc = await Document.buildFromId(await member.get('documentId'), context?.user?.id, 'Mutation.deleteDocumentMember', context);
  doc.publishEvent(context.pubsub, 'EDIT');
  return deleteResult;
};

export default { addDocumentMember, editDocumentMember, deleteDocumentMember };
